    value: 'Report is amended in response to Letter of Inquiry dated 1/14/09. The
      receipt of $45,150 from John McCain 2008 and reported on Schedule A supporting
      Line 15 represents a reimbursement of direct mail costs paid for and reported
      on Schedule B line 30b on 10/7/08. There is a contribution of $10,000 from James
      Palmer on 9/25/08 reported as a Memo Entry relating to the Transfer from the
      McCain Victory Florida committee reported on Schedule A, Line 12. This person
      has already reached their maximum contribution level to the Republican Party
      of Florida and we have subsequently refunded his contribution in October. All
      disbursements for salaries and benefits disclosed on Schedule H4 are for employees
      who did not spend more than 25% of their compensated time during the reporting
      period on Federal election activities or activities in connection with a Federal
      election. The Committee uses the Escrow option for receipt of corporate in-kind
      donations as provided for by the Commission in Advisory Opinion 1992-33. The
      method ensures that prohibited sources are not used to fund the federal share
      of allocable activity expenses. In-kind details and the escrow account activity
      are summarized as follows:  Administrative Escrow account and In-kinds  9/1/08
      balance in Administrative escrow account of $11,957.30.  9/9/08 Yuma Solutions
